prompt Creating TRAILS...
create table TRAILS
(
  trail_name       VARCHAR2(255) not null,
  trail_id         NUMBER(6) not null,
  difficulty_level VARCHAR2(50) not null,
  location         VARCHAR2(255) not null,
  price            FLOAT not null,
  open_closed      VARCHAR2(10) not null,
  trail_rating     NUMBER
)

alter table TRAILS
  add primary key (TRAIL_ID)


prompt Creating BIKING_TRAILS...
create table BIKING_TRAILS
(
  length              NUMBER(5) not null,
  terrain_description VARCHAR2(255),
  rental_on_site      VARCHAR2(50) not null,
  trail_id            NUMBER(6) not null
)

alter table BIKING_TRAILS
  add primary key (TRAIL_ID)

alter table BIKING_TRAILS
  add foreign key (TRAIL_ID)
  references TRAILS (TRAIL_ID);

prompt Creating CUSTOMERS...
create table CUSTOMERS
(
  traveler_id         NUMBER(6) not null,
  traveler_name       VARCHAR2(255) not null,
  traveler_age        NUMBER(3) not null,
  contact_info        VARCHAR2(15) not null,
  number_of_travelers NUMBER(4) not null,
  trip_date           DATE not null,
  birth_date          DATE not null
)

alter table CUSTOMERS
  add primary key (TRAVELER_ID)


prompt Creating BIKERS_ON_TRAIL...
create table BIKERS_ON_TRAIL
(
  traveler_id NUMBER(6) not null,
  trail_id    NUMBER(6) not null,
  rating      NUMBER(1) not null
)

alter table BIKERS_ON_TRAIL
  add primary key (TRAVELER_ID, TRAIL_ID)

alter table BIKERS_ON_TRAIL
  add foreign key (TRAVELER_ID)
  references CUSTOMERS (TRAVELER_ID);
alter table BIKERS_ON_TRAIL
  add foreign key (TRAIL_ID)
  references BIKING_TRAILS (TRAIL_ID);

prompt Creating PAYMENT...
create table PAYMENT
(
  payment_id   NUMBER(6) not null,
  amount       FLOAT not null,
  payment_date DATE not null
)

alter table PAYMENT
  add primary key (PAYMENT_ID)


prompt Creating CUSTOMERS_PAYMENT...
create table CUSTOMERS_PAYMENT
(
  payment_id  NUMBER(6) not null,
  traveler_id NUMBER(6) not null
)

alter table CUSTOMERS_PAYMENT
  add primary key (PAYMENT_ID)

alter table CUSTOMERS_PAYMENT
  add foreign key (PAYMENT_ID)
  references PAYMENT (PAYMENT_ID);
alter table CUSTOMERS_PAYMENT
  add foreign key (TRAVELER_ID)
  references CUSTOMERS (TRAVELER_ID);

prompt Creating EMPLOYEES...
create table EMPLOYEES
(
  employee_name VARCHAR2(255) not null,
  employee_id   NUMBER(6) not null,
  seniority     NUMBER(3) not null,
  contact_info  VARCHAR2(255) not null,
  age           NUMBER(3) not null
)

alter table EMPLOYEES
  add primary key (EMPLOYEE_ID)


prompt Creating EMPLOYEE_AT_TRAIL...
create table EMPLOYEE_AT_TRAIL
(
  employee_id NUMBER(6) not null,
  trail_id    NUMBER(6) not null,
  work_date   DATE not null,
  job         VARCHAR2(15) not null
)

alter table EMPLOYEE_AT_TRAIL
  add primary key (EMPLOYEE_ID, TRAIL_ID)

alter table EMPLOYEE_AT_TRAIL
  add foreign key (EMPLOYEE_ID)
  references EMPLOYEES (EMPLOYEE_ID);
alter table EMPLOYEE_AT_TRAIL
  add foreign key (TRAIL_ID)
  references TRAILS (TRAIL_ID);

